    public function GetShopAccountingManager_getOrderFiles() {
        $this->includefile("fileoverview");
        
        $file = $this->getApi()->getGetShopAccountingManager()->getOrderFile($_POST['data']['id']);
        
        $first = true;
        foreach ($file->orders as $orderId) {
            $orderPrinter = new \ns_f22e70e7_7c31_4c83_a8c1_20ae882853a7\OrderSimplePrinter();
            $orderPrinter->setOrderId($orderId);
            $orderPrinter->setCompactView();
            
            if ($first) {
                $orderPrinter->setPrintHeader();
            }
            
            $orderPrinter->renderApplication(true);
            $first = false;
        }
        
        if (isset($file->accountingTransactionOutOfScope)) {
            $this->printAccountingTransactions($file->accountingTransactionOutOfScope, "Orders outside of this scope (will be accounted for later)");
        }
        
        if (isset($file->accountingTransactionProcessedInADifferentFile)) {
            $this->printAccountingTransactions($file->accountingTransactionProcessedInADifferentFile, "Accounted for in a later file.");
        }
    }
    
    private function printAccountingTransactions($transactions, $text) {
        $first = true;
        if (count($transactions)) {
            echo "<h2>$text</h2>";
            $orderList = array();
            foreach ($transactions as $outOfScope) {
                foreach ($outOfScope->orderIds as $orderId) {
                    $orderList[] = $orderId;
                }
            }
            
            $orderList = array_unique($orderList);
            
            foreach ($orderList as $orderId) {
                $orderPrinter = new \ns_f22e70e7_7c31_4c83_a8c1_20ae882853a7\OrderSimplePrinter();
                $orderPrinter->setOrderId($orderId);
                $orderPrinter->setCompactView();

                if ($first) {
                    $orderPrinter->setPrintHeader();
                }

                $orderPrinter->renderApplication(true);
                $first = false;
            }
        }
    }
    
    public function formatNumber($data, $colVal) {
        if (!$colVal) {
            return "-";
        }
        return number_format($colVal, 0, ",", ' ');
    }
    
    public function formatStartDate($row) {
        if (!$row->startDate) {
            return "-";
        }
        return \GetShopModuleTable::formatDate($row->startDate);
    }
    
    public function formatEndDate($row) {
        if (!$row->endDate) {
            return "-";
        }
        return \GetShopModuleTable::formatDate($row->endDate);
    }
    
    public function formatCreatedDate($row) {
        return \GetShopModuleTable::formatDate($row->rowCreatedDate);
    }
    
    public function printFileTable($data) {
        
        $attributes = array(
            array('id', 'gs_hidden', 'id'),
            array('rowCreatedDate', 'Date crated', 'rowCreatedDate', 'formatCreatedDate'),
            array('startDate', 'From', 'startDate', 'formatStartDate'),
            array('endDate', 'To', 'endDate', 'formatEndDate'),
            array('orders', 'Orders', 'orders', 'formatOrderCount'),
            array('amountEx', 'Total ex taxes', 'amountEx', 'formatNumber'),
            array('amountInc', 'Total inc taxes', 'amountInc', 'formatNumber'),
            array('amountExDebet', 'Total ex debet', 'amountExDebet', 'formatNumber'),
            array('amountIncDebet', 'Total inc debet', 'amountIncDebet', 'formatNumber'),
            array('download', 'Download', null, 'formatDownload')
        );
        
        $args = array(null);
        $table = new \GetShopModuleTable($this, 'GetShopAccountingManager', 'getOrderFiles', $args, $attributes);
        $table->setData($data);
        $table->avoidAutoExpanding();
        $table->render();
    }

    public function groupData() {
        $orderFiles = $this->getApi()->getGetShopAccountingManager()->getOrderFiles();
        $retarray = array();
        
        if (!is_array($orderFiles)) {
            return array();
        }
        
        foreach ($orderFiles as $file) {
            if (!isset($retarray[$file->subtype])) {
                $retarray[$file->subtype] = array();
            }
            
            $retarray[$file->subtype][] = $file;
        }
        
        return $retarray;
    }

    public function setEndDate() {
        
        if (!$_POST['data']['endDate']) {
            $this->clearSession();
            return;
        }
        
        $_SESSION['AccountingDownload_endDate'] = date('Y-m-d 23:59:59', strtotime($_POST['data']['endDate']));
        unset($_SESSION['AccountingDownload_filesCreated']);
    }
    
    public function cancelOverview() {
        unset($_SESSION['AccountingDownload_endDate']);
    }
    
    public function deleteFile() {
        $this->getApi()->getGetShopAccountingManager()->deleteFile($_POST['data']['fileId'], $_POST['data']['password']);
    }
    
    public function createFiles() {
        $time = $this->convertToJavaDate(strtotime($_SESSION['AccountingDownload_endDate']));
        $_SESSION['AccountingDownload_filesCreated'] = $this->getApi()->getGetShopAccountingManager()->createNextOrderFile($time);

        if (!$_SESSION['AccountingDownload_filesCreated']) {
            $_SESSION['AccountingDownload_filesCreated'] = "null";
        }
    }
    
    public function clearSession() {
        unset($_SESSION['AccountingDownload_endDate']);
        unset($_SESSION['AccountingDownload_filesCreated']);
    }
    
    public function transferFromOldSystem() {
        $this->getApi()->getAccountingManager()->transferAllToNewSystem();
    }
    
    public function markAsTransferred() {
        $order = $this->getApi()->getOrderManager()->getOrder($_POST['data']['orderid']);
        $order->transferredToAccountingSystem = true;
        $order->triedTransferredToAccountingSystem  = true;
        $this->getApi()->getOrderManager()->saveOrder($order);
    }
    
    public function transferToNewFReport() {
        $this->getApi()->getOrderManager()->transferToNewFReport();
    }
